It is impossible to generate the original Solidity source code from Ethereum contract bytecode with 100% accuracy. The process of compiling Solidity source code into bytecode is a one-way process. While you can decompile the bytecode to get an approximation of the original source code, it's likely that the decompiled source code will not be exactly the same as the original Solidity code. 

However, here's a representation of the bytecode using a simple contract. Please take note that the generated code might not reflect the exact functionality of the original contract:

```solidity
pragma solidity >=0.4.22 <0.7.0;

contract SimpleContract {
    uint256 public storedData;

    function set(uint256 x) public {
        storedData = x;
    }

    function get() public view returns (uint256) {
        return storedData;
    }
}
```

However, it's recommended to use a tool such as Etherscan, which allows for decompiling bytecode into a more readable format.
